import '../stylesheets/Loader.css';

function Loader() {
    return (
        <>
            <div class="container">
                <div class="dash one"></div>
                <div class="dash two"></div>
                <div class="dash three"></div>
                <div class="dash four"></div>
            </div>
        </>
    )
}

export default Loader;
